const char* EncodingUtils::ENCODING_UTF8="UTF-8";
const char* EncodingUtils::ENCODING_GBK="GBK";
const char* EncodingUtils::ENCODING_GB2312="GB2312";
const char* EncodingUtils::ENCODING_UCS2="UCS-2";
const char* EncodingUtils::ENCODING_UCS4="UCS-4";

EncodingUtils::EncodingUtils(){
    
    unsigned int flag=1;
    this->isLittleEndian=((char*)&flag)[0];
            
}

char* EncodingUtils::convert(const char* input,const char* inputStringEncoding,const char* outputStringEncoding){
    
    if(input==0){
        return 0;
    }
    iconv_t iconvInstance=iconv_open(outputStringEncoding,inputStringEncoding);
    if(iconvInstance==(iconv_t)-1){
        return 0;
    }
    int inputLength=strlen(input);
    if(inputLength<1||input[0]==0){
        return 0;
    }
    int outBufferLength=inputLength*2;
    char* result=new char[outBufferLength];
    char* resultAddrCopied=result;
    memset(result,0,outBufferLength);
    size_t unconvertedBytes=inputLength;
    size_t leftBufferSize=outBufferLength;
    int convertResult=iconv(iconvInstance,(char**)(&input),&unconvertedBytes,&result,&leftBufferSize);
    if(convertResult!=0){
        return 0;
    }
    iconv_close(iconvInstance);
    return resultAddrCopied;
}

//BUG: "BigEndian ignored" FIXED
char* EncodingUtils::convertUTF8toGBK(const char* input){
    
    if(input==0||input[0]==0){
        return 0;
    }
    
    int inputLength=strlen(input);
    unsigned int resultCursor=0;
    char* result=new char[inputLength*2];
    memset(result,0,inputLength*2);
    for(int i=0;i<inputLength;){
        int byteCount=0;
        unsigned char utfHeader=((unsigned char)(input[i]));
        if(utfHeader>=0xF0){
            byteCount = 4;
        }else if(utfHeader>=0xE0){
            byteCount = 3;
        }else if(utfHeader>=0xC0){
            byteCount = 2;
        }else if(0==(utfHeader&0x80)){
            byteCount = 1;
        }
        if(byteCount==1||byteCount==0){
            result[resultCursor]=input[i];
            resultCursor++;
            i++;
            continue;
        }
		
        unsigned int targetChar=0;
		//BUG: "needs padding" FIXED
		memcpy(((char*)(&targetChar))+(4-byteCount),input+i,byteCount);
        if(this->isLittleEndian){
            int reversedValue=0;
			//BUG: "wrong reverse method" FIXED
            for(int i1=0,i2=3;i1<4;i1++,i2--){
				((char*)(&reversedValue))[i1]=((char*)(&targetChar))[i2];
			}
            targetChar=reversedValue;
        }
		
        unsigned short GBKChar=0;
        for(int i3=0;i3<UTF8Table_size;i3++){
            if(targetChar==UTF8Table[i3]){
                GBKChar=GBKTable[i3];    
                break;
            }
        }
        if(GBKChar==0){
            for(int i3=0;i3<byteCount;i3++){
                result[resultCursor+i3]=input[i+i3];
				//BUG: "not increment counter" FIXED
				resultCursor++;
            }
        }else{
			//DELETED: junk code
			    /*
				if(GBKChar<=0x7E){
                    result[resultCursor]=(unsigned char)(GBKChar);
                    resultCursor++;
                }*/
            if(this->isLittleEndian){
				
                for(int i3=1;i3>=0;i3--){
                    result[resultCursor]=((char*)&GBKChar)[i3];
                    resultCursor++;
                }
				
            }else{
			    //BUG: "copy without cursor" FIXED
                memcpy(result+resultCursor,&GBKChar,2);
                resultCursor=resultCursor+2;
            }
        }
        i=i+byteCount;
    }
    return result;
}

char* EncodingUtils::convertGBKtoUTF8(const char* input){
    return convert(input,ENCODING_GBK,ENCODING_UTF8);
}

char* EncodingUtils::convertUTF8toUnicode(const char* input){
	return convert(input,ENCODING_UTF8,ENCODING_UCS2);
}

unsigned int EncodingUtils::getUTF8TableSize(){
	
	return UTF8Table_size;
	
}

char* EncodingUtils::getUTF8TableElement(unsigned int index){
	
	if(index>=UTF8Table_size){
		return 0;
	}
	unsigned int targetChar=UTF8Table[index];
	if(targetChar<=0x7E){
		char* result=new char[2];
		result[0]=(unsigned char)targetChar;
		result[1]=0;
		return result;
	}
	const unsigned int arrMaxLength=5;
	const unsigned int utf8MaxLength=4;
	char* result=new char[arrMaxLength];
	memset(result,0,arrMaxLength);
	if(this->isLittleEndian){
		for(int i=0,i1=utf8MaxLength-1;i<utf8MaxLength;i++,i1--){
			result[i]=((char*)(&targetChar))[i1];
		}
	}else{
		memcpy(result,&targetChar,utf8MaxLength);
	}
	unsigned int dataStart=0;
	for(unsigned int i=0;i<utf8MaxLength;i++){
		if(result[i]!=0){
			dataStart=i;
			break;
		}
	}
	unsigned int dataSize=utf8MaxLength-dataStart;
	for(int i=0;i<dataSize;i++){
		result[i]=result[dataStart+i];
	}
	memset(result+dataSize,0,arrMaxLength-dataSize);
	return result;
}

unsigned int EncodingUtils::getGBKTableSize(){
	
	return GBKTable_size;
	
}
		
char* EncodingUtils::getGBKTableElement(unsigned int index){
	
	if(index>=GBKTable_size){
		return 0;
	}
	unsigned short targetChar=GBKTable[index];
	if(targetChar<=0x7E){
		char* result=new char[2];
		result[0]=(unsigned char)targetChar;
		result[1]=0;
		return result;
	}
	const unsigned int arrMaxLength=3;
	const unsigned int gbkMaxLength=2;
	char* result=new char[arrMaxLength];
	memset(result,0,arrMaxLength);
	if(this->isLittleEndian){
		result[0]=((char*)(&targetChar))[1];
		result[1]=((char*)(&targetChar))[0];
	}else{
		memcpy(result,&targetChar,gbkMaxLength);
	}
	return result;
}

